import "./components/Item.css";
import "./App.css";
import { v4 as uuidv4 } from 'uuid';
import PropTypes from 'prop-types';

const Title = () => 
<h1 className="item">
  โปรแกรมรายรับ - รายจ่าย
</h1>
const Description = () => <p>บันทึกข้อมูลบัญชีในแต่ละวัน</p>

const Item = ({title,amount})=>{
  return(
    <li>{title}<span>{amount}</span></li>
  );
}

const Transaction = () => {
  const data = [
    {title:5555,amount:"2000"},
    {title:"ค่าเดินทาง",amount:1000},
    {title:"ค่าที่พัก",amount:5000},
    {title:"ค่ารักษาพยาบาล",amount:3000}
  ]
  data.propTypes={
    title:PropTypes.string,
    amount:PropTypes.number
  }
  return (
    <ul className="item-list">
      {data.map((i)=>{
        return <Item {...i} key={uuidv4()}/>
      }
      )}
    </ul>
  );
}

function App() {
  return (
    <div>
      <Title/>
      <Description/>
      <Transaction/> 
    </div>          
  );
}

export default App;
